    Lidar Survey of Breton and Gosier Islands, Louisiana, January 16 and 18, 2014",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-04-13T06:49:40.738465",nt"name": "topobathymetric-lidar-survey-of-breton-and-gosier-islands-louisiana-january-16-and-18-20143db59",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains binary point-cloud
    data, produced from remotely sensed, geographically referenced topobathymetric measurements
    collected by Photo Science, Inc., encompassing the Breton and Gosier Island, LA
    study areas. The original area of interest was buffered by 100 meters to ensure
    complete coverage, resulting in approximately 75 square miles of lidar data. The
    Breton Island Lidar project called for the planning, acquisition, processing, and
    derivative products of topobathymetric lidar data, collected at a nominal pulse
    spacing (NPS) of 0.5-0.45 meters (4-5 points/square meter). Lidar acquisition was
    prioritized to coincide with the lowest tide possible. Water clarity was also assessed
    and deemed acceptable prior to acquisition flights. The data, in meters, are projected
    to UTM Zone 16 North and referenced horizontally to the NAD83 (2011) datum and vertically
    to the NAVD88 (GEOID12A) datum. The classified point-cloud data were delivered in
    LAS v1.2 format and the merged DEM was converted to a GeoTIFF file. Each LAS file
    contains data in a 1-kilometer by 1-kilometer tile named according to the US National
    Grid conventions. The final product was a LAZ file for Breton Island and another
    for Gosier Islands.",nt"license_title": null,nt"extras": [{ntt"key":
